import React from 'react';
import {Card,CardAction, CardActionArea,CardContent,CardMedia,Button,Typography } from '@material-ui/core';

const NewsCard=({article:{description,punlishedAt,source,title,url,urlToImage},i})=>{
    return(
        <Card>
            <CardActionArea>
                <CardMedia image={urlToImage ||'https://www.google.com/search?q=news+image+png&rlz=1C5CHFA_enIN893IN893&sxsrf=ALeKk0305ELrGBVEqoTaq7s3fDV8b4g8mw:1597749599564&source=lnms&tbm=isch&sa=X&ved=2ahUKEwilvMmK0aTrAhVKaCsKHfY1AMEQ_AUoAXoECAwQAw&biw=1440&bih=821#imgrc=UZGsFxT88DsYQM'}/>
                <div>
                    <Typography variant="body2" color="textSecondary" component="h2">{(new Date(publishedAt)).toDateString()}</Typography>
                    <Typography variant="body2" color="textSecondary" component="h2">{source.name}</Typography>
                </div>
                 <Typography gutterBottom variant="h2">{description}</Typography>
                <CardContent>
                     <Typography variant="body2" color="textSecondary" component="p"></Typography>
                </CardContent>
            </CardActionArea>
            <CardAction>
                <button size="small" color="primary">Learn More</button>
            <Typography variant="body2" color="textsecondary">{i+1}</Typography>
            </CardAction>
        </Card>
    );
}

export default NewsCard;
